import { booksByGenre } from "./Api";

export function GetBookByID(bookID) {
  for (const genre in booksByGenre) {
    console.log('Genre' + genre)
    const book = booksByGenre[genre].find(b => b.id === bookID);
    if (book) return book;
  }
  return null;
}
